import React from "react";
import LogIn from "./LogIn";
import image from "./Images/DogCat.jpeg";

function Home() {
  return (
    <div className="pageCard row justify-content-center">
      <div className="pb-2 col-12 col-md-6 order-md-2">
        <div className="logoHeight">
          <h2 className="titleFont m-0">Pet</h2>
          <h2 className="titleFont m-0">Friend.ly</h2>
        </div>
        <div className="formHeight align-self-center bg-dark">
          <LogIn></LogIn>
        </div>
      </div>

      <div className="img-responsive imgHeight pb-2 col-12 col-md-6 order-md-1">
        <img src={image} alt=""></img>
      </div>
    </div>
  );
}

export default Home;
